import {Link} from 'react-router-dom';

import Navigation from './Navigation'

export default class Header extends Component {
    render() {
        return (
            <header className="p-3" style={{backgroundColor:'#DC2A35'}}>
                <img src="https://exam.ioe.edu.np/Public/Notice/tu-logo.jpg" width="50" />
                <h1 className="m-1 d-flex justify-content-center text-white">Institute of Engineering</h1>
                <h6 className="m-1 d-flex justify-content-center text-white">Pulchowk Campus</h6>
                {/*<Link to='/' style={linkStyle}>Home</Link> | <Link to='/classes' style={linkStyle}> Class </Link> | <Link to='/instructor' style={linkStyle}>Instructor</Link>*/}
                <Navigation></Navigation>
            </header>
        )
    }
}
